import React from "react";
import { Link, useNavigate } from "react-router-dom";
import Nostaoverview from "./../pages/nostraoverview";

function Click() {
    const navigate = useNavigate();

    const handleClick = () => {
        navigate("/pages/nostaoverview");
    };

    return (
        <div>
            <h1 className="text-bold bg-slate-950 text-white">Button Click</h1>
            
            {/* Correct the relative path */}
            <Link to="/pages/nostaoverview">Go To Overview Pages</Link>

            {/* Attach the click handler to the button */}
            <button  className="bg-white"  onClick={handleClick}>Go To Overview Pages</button>
        </div>
    );
}

export default Click;
